  \"2013-03-14T19:50:10.374663\",\n\t\"name\": \"national-wetlands-inventory-nwi\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NWI digital data files are records of wetlands
  location and classification as defined by the U.S. Fish & Wildlife Service. This
  dataset is one of a series available in 7.5 minute by 7.5 minute blocks containing
  ground planimetric coordinates of wetlands point, line, and area features and wetlands
  attributes. When completed, the series will provide coverage for all of the contiguous
  United States, Hawaii, Alaska, and U.S. protectorates in the Pacific and Caribbean.
  The digital data as well as the hardcopy maps that were used as the source for the
  digital data are produced and distributed by the U.S. Fish & Wildlife Service's
  National Wetlands Inventory project.\",\n\t\"license_title\": null,\n\t\"extras\":
  [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\": \"[{\"name\": \"U.S. Fish
